{
  extends: ["config:base"],
  dependencyDashboard: true,
  labels: ["dependencies"],
  packageRules: [
    {
      groupName: "all non-major dev dependencies",
      groupSlug: "all-dev-minor-patch",
      matchPackagePatterns: ["*"],
      excludePackagePatterns: [
        // typedoc upgrades require manually validating the generated website
        "typedoc",
        // vuepress and related deps tend to break things often and require manual inspection
        "vue",
        "vuepress",
      ],
      matchDepTypes: ["devDependencies"],
      matchUpdateTypes: ["minor", "patch"],
    },
  ],
}

{
  "extends": "./tsconfig.base.json",
  "references": [
    {
      "path": "./packages/regexp-to-ast"
    },
    {
      "path": "./packages/utils"
    },
    {
      "path": "./packages/types"
    },
    {
      "path": "./packages/gast"
    },
    {
      "path": "./packages/cst-dts-gen"
    },
    {
      "path": "./packages/chevrotain"
    },
    {
      "path": "./packages/cst-dts-gen-test"
    }
  ],
  // needed to avoid trying to compile other .ts files in this repo
  // and/or try to compile files included in the above references, only with incorrect settings
  "files": [],
  "include": [],
  "exclude": []
}
